import React from "react";
import styled from "styled-components";

const ModalAddTags = ({ content }) => <Container>{content}</Container>;

const Container = styled.button`
  background-color: #fff;
  color: #fff;
  width: 450px;
  height: 500px;
  border-radius: 10px;
  display: flex;
`;

export default ModalAddTags;
